import React from "react";
import Card from "./Card";

function Team() {
  let info = [
    {
      image: "./images/morocain-players/bono.jpg",
      id: 3,
      name: "Yassine Bounou",
      position: "Goalkeeper",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
    {
      image: "./images/morocain-players/amrabet.jpg",
      id: 1,
      name: "Sofyan Amrabat",
      position: "Midfielder",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
    {
      image: "./images/morocain-players/bofal.jpeg",
      id: 2,
      name: "Sofiane Boufal",
      position: "Attacking midfielder",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
    {
      image: "./images/morocain-players/sais.jpeg",
      id: 4,
      name: "Romain Saïss",
      position: "Centre-back defance",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
    {
      image: "./images/morocain-players/hakimi.jpg",
      id: 5,
      name: "Achraf Hakimi",
      position: "Right-back defance",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
    {
      image: "./images/morocain-players/ziach.jpg",
      id: 6,
      name: "Hakim Ziyech",
      position: "Attacking midfielder",
      // phone: "+212613411697",
      // email: "haitam.skhairi@gmail.com",
      // website: "www.haitamskhairi.com",
    },
  ];

  let members = info.map((member) => {
    return (
      <Card
        image={member.image}
        key={member.id}
        name={member.name}
        position={member.position}
        // phone={member.phone}
        // email={member.email}
        // website={member.website}
      />
    );
  });

  return <div className="row">{members}</div>;
}

export default Team;
